import axios from 'axios';

export const GET_REGION = 'GET_REGION';

export const getRegion = () => {
  const fetch = async () => {
    axios.get('http://api.training.div3.pgtest.co/api/v1/location');
    const payload = res.data.data;
    return { type: GET_REGION, payload: payload };
  };
  fetch();
};
